func (c *current) onstart1(tlb interface{}) (interface{}, error) {
	n := &html.Node{
		Type: html.DocumentNode,
	}
	addChild(n, tlb)
	if len(c.state) > 0 {
		panic(errors.Errorf("poluted state! %#v", c.state))
	}
	return n, nil
}

